import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import Sdata from "./Sdata";
import "./index.css";

ReactDOM.render(
    <>
    <h1 className="heading"> Top 5 Netflix List </h1>
      <Card 
        imgsrc = {Sdata[0].imgsrc}
        catagory = {Sdata[0].catagory}
        title = {Sdata[0].title}
        link = {Sdata[0].link}
      />
      <Card 
        imgsrc = "https://images.pexels.com/photos/695476/pexels-photo-695476.jpeg?auto=compress&cs=tinysrgb&w=600&lazy=load"
        catagory = "Netflix Original Series"
        title = "SKY"
        link = "https://www.pexels.com/"
      />
      <Card 
        imgsrc = "https://images.pexels.com/photos/14030389/pexels-photo-14030389.jpeg?auto=compress&cs=tinysrgb&w=600&lazy=load"
        catagory = "Netflix Original Series"
        title = "Cat"
        link = "https://www.pexels.com/"
      />  
    </>
    ,
    document.getElementById("root")
);
